#! /bin/sh
# Evaluate performance of taking the length of strings.
# Results:
#   - ksh: constant
#   - *: linear

if [ $# -lt 1 ]; then
  set ksh dash bash zsh
fi

while [ $# -gt 0 ]; do
  echo "\n$1: length of 2^5 characters string"
  time $1 -c 'acc=0; i=0; c="aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa"; while [ $i -lt 1000 ]; do i=$((i+1)); if [ -z $c ]; then acc=$((acc + 1)); fi ; done';

  echo "\n$1: length of 2^10 characters string"
  time $1 -c 'acc=0; i=0; c=""; while [ $i -lt 1000 ]; do i=$((i+1)); if [ -z $c ]; then acc=$((acc + 1)); fi ; done';

  echo "\n$1: length of 2^15 characters string"
  time $1 -c 'acc=0; i=0; c=""; while [ $i -lt 1000 ]; do i=$((i+1)); if [ -z $c ]; then acc=$((acc + 1)); fi ; done';

  # To generate longer strings: c="a"; i=0; while [ $i -lt 11 ]; do i=$((i+1)); c="$c$c"; done; echo $c | pbcopy
  shift
done
